import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import './css/bootstrap.css'
import './vendors/linericon/style.css'
import './css/font-awesome.min.css'
import './vendors/owl-carousel/owl.carousel.min.css'
import './vendors/lightbox/simpleLightbox.css'
import './vendors/nice-select/css/nice-select.css'
import './vendors/animate-css/animate.css'
import './vendors/popup/magnific-popup.css'
import './vendors/flaticon/flaticon.css'
import './css/style.css'
import './css/responsive.css'
import './js/jquery-3.3.1.min.js'
import './js/popper.js'
import './js/bootstrap.min.js'
import './js/stellar.js'
import './vendors/lightbox/simpleLightbox.min.js'
import './vendors/nice-select/js/jquery.nice-select.min.js'
import './vendors/isotope/imagesloaded.pkgd.min.js'
import './vendors/isotope/isotope.pkgd.min.js'
import './vendors/owl-carousel/owl.carousel.min.js'
import './vendors/popup/jquery.magnific-popup.min.js'
import './js/jquery.ajaxchimp.min.js'
import './vendors/counter-up/jquery.waypoints.min.js'
import './vendors/counter-up/jquery.counterup.min.js'
import './js/mail-script.js'

import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
